import React, { useEffect, useState } from 'react'

const Contact = () => {    
    const [userData, setUserData] = useState({})

    const getUserContact = async () => {
        try {
            const res = await fetch('/getdata', {
                method: 'GET',
                headers: {
                    "Content-Type": "application/json"
                }
            })

            const data = await res.json()
            setUserData(data)
            console.log(data);

            if(!res.status === 200){
                const error = new Error(res.error)
                throw error
            }

        } catch (err) {
            console.log(err);
        }
    }

    useEffect(() => {
        getUserContact()
    }, [])

    return (
        <div>
            <h1>Contact Us</h1>
            <form>
                Name: <input value={userData.name}></input>
                Email: <input val></input>
                Message: <input></input>
            </form>
            <h5></h5>
            <h5></h5>
        </div>
    )
}

export default Contact
